import { APIRequest } from './api-request';
export class PerformerCategoriesService extends APIRequest {
  getList(query) {
    return this.get(this.buildUrl('/performer-categories', query));
  }

  details(id) {
    return this.get(`/performer-categories/${id}/view`);
  }

}
